import react from "react";
import "./Extra.css";
function Extra(){
  return(
    <section className="extra-wrapper">
      <div className="padding innerWidth flexCenter extra-container">
      <div className="extra-left">
        <div className="extra-title">
          <h1>
            Discover <br /> Most Perfect <br /> Property</h1>
        </div>
        <div className="extra-des">
          <span>Find Beautiful Properties that suite you the best</span>
          <span>You will not face any difficulties in finding </span>

        </div>
      </div>
      <div className="flexCenter extra-right">
      
        <div className="image-container">
          <img src="./buildings.png" alt="main image" />
        </div>
      </div>
      </div>
    </section>
  );
}
export default Extra;
